import React, { useState } from 'react';
import postService from '../services/postService';

function CreateComponent() {

    const [title, setTitle] = useState('');
    const [date, setDate] = useState('');
    const [image, setImage] = useState('');
    const [message, setMessage] = useState('');

    const handleSubmit = async (event) => {
        event.preventDefault(); // Prevent default form submission behavior
        // Here you can perform any actions you want with the form data, such as sending it to a server or processing it
       
       
        const FormData = new FormData();

        FormData.append('title',title);
        FormData.append('date',date);
        FormData.append('image',image);
       
        const response = await postService.create(FormData);
        event.target.reset();
    }

    return (
        <div>
            <h2>Welcome yasin</h2>
            <form onSubmit={handleSubmit} id="insert_form" >
                <label>
                    Title:
                    <input type="text" name='title' value={title} onChange={(e) => setTitle(e.target.value)} required />
                </label>
                <br /><br/>
                <label>
                    Date:
                    <input type="date" name="date" value={date} onChange={(e) => setDate(e.target.value)} required />
                </label>
                <br /><br />
                <label>
                    Image:
                    <input type="file" name="image" value={image} onChange={(e) => setImage(e.target.value)} required />
                </label>
                <br /><br />
              
                <button type="submit">Submit</button>
            </form>
            <p>{message}</p>
        </div>
    );
}

export default CreateComponent;
